import React from 'react';
import './style.css';

const SecaoCapa = () => {
    return (
        <section className='secao-capa'>
            <div className='capa center'>
                <div className='texto-capa'>
                    <p>Sua melhor parada</p>
                    <h1>TRUCK STOP</h1>
                    <p>O Brasil registra mais de 50 mil acidentes com vítimas por ano, muitos deles envolvendo caminhões. Muitos desses acidentes poderiam ter sido evitados se houvesse uma parada de descanso e reabastecimento, fazendo com que o motorista estivesse mais disposto e atento ao dia, para resolver esse problema, criamos a Truck Stop.</p>
                </div>
            </div>
        </section>  
    )
}

export default SecaoCapa;
